"""# CADENAS

Las cadenas también son datos estructurados, y se pueden ver como vectores de caracteres, donde cada caracter es una componente del vector.

La igual que en otros tipos de datos:

![image.png](data:image/png;base64,)

Decimos que "a" apunta al valor 2 y que "b" apunta al valor 3.25. La flecha recibe el nombre de puntero o referencia. De igual forma, sucede con las cadenas o strings.

La memoria del computador se compone de una serie de celdas numeradas con sus direcciones. En cada celda cabe un escalar. La cadena 'Hola' ocupa cuatro celdas, una por cada caracter. Por otra parte, una variable sólo puede contener un escalar. Como la dirección de memoria es un numero y, por tanto, un escalar, el "truco" consiste en almacenar en la variable la dirección de memoria en la que empieza la cadena.

![image.png](data:image/png;base64,)
"""

a = "Hola"
print(a)
print(type(a))
print(a[0])
print(a[0:2])
print(id(a)) # imprime la direccion de memoria

"""![image.png](data:image/png;base64,)"""

a = "Hola" # Se crea un objeto string "Hola" en memoria y se asigna a 'a'
b = a   # 'b' apunta al mismo objeto que 'a'
print(b)
#  ambas variables, a y b, hacen referencia al mismo objeto en memoria.
# No se crea una copia de "Hola", solo otra referencia a la misma ubicación.
print(a==b)
print(id(a))  # Imprime la dirección de memoria donde está almacenado "Hola"
print(id(b))  # Imprime la dirección de memoria donde está almacenado "Hola"
print(id(a)==id(b)) # a y b apuntan hacia la misma dirección
print(a is b)
#El operador is en Python verifica si dos variables hacen referencia al mismo objeto en memoria.

a = "Una cadena"
b = "Una cadena"

print(a==b)
print(a is b)

